import React, { Component } from 'react';

import UsersCard from './components/Users/UsersCard';
import KPIs from './components/KPIs/KPIs';
import Employees from './components/Employees/Employees';

import { Tabs, Tab } from '@blueprintjs/core';

export default class AdminPanel extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });

   render() {
      return (
         <div>
            <Tabs onchange={this.handleTabChange} large>
               <div className='mb-2 position-absolute'> somce content</div>
               <br></br>
               <Tab id='1' title='Users' panel={<UsersCard />} />
               <Tab id='2' title='Employees' panel={<Employees />} />
               <Tab id='3' title='KPIs' panel={<KPIs />} />
            </Tabs>
         </div>
      );
   }
}
